// src/pages/ProfilePage.jsx
import React from 'react';

const ProfilePage = () => {
  return (
    <div style={{ padding: '2rem' }}>
      <h1>Profile</h1>
      <p>Manage your profile settings</p>
    </div>
  );
};

export default ProfilePage;
